CREATE DATABASE senai;
USE senai;

CREATE TABLE usuario(4
    id INT PRIMARY KEY AUTO_INCREMENT,
    nome VARCHAR(100),
    idade INT,
    email VARCHAR(100) UNIQUE,
    senha VARCHAR(100)
);


CREATE TABLE lgs(
	id INT PRIMARY KEY AUTO_INCREMENT,
	categoria TEXT,
    horas_trabalhadas INT,
    linha_de_codigo INT,
    bugs_corrigidos INT
);

CREATE TABLE likes(
	id INT PRIMARY KEY AUTO_INCREMENT,
    id_log INT,
    FOREIGN KEY (id_log)
    REFERENCES lgs(id),
    id_user INT,
    FOREIGN KEY (id_user)
    REFERENCES usuario(id)
);


SELECT * FROM likes;


SELECT
        lgs.id,
        lgs.categoria,
            lgs.horas_trabalhadas,
            lgs.linha_de_codigo,
            lgs.bugs_corrigidos,
            COUNT(senai.likes.id_log) AS likes,
            COUNT(senai.comment.id_log) AS qtd_comments
        FROM
        senai.lgs
        LEFT JOIN senai.likes
        ON senai.likes.id_log = senai.lgs.id
        LEFT JOIN senai.comment
        ON senai.comment.id_log = senai.lgs.id
        GROUP BY
        lgs.id,
            lgs.categoria,
            lgs.horas_trabalhadas,
            lgs.linha_de_codigo,
            lgs.bugs_corrigidos
        ORDER BY senai.lgs.id asc
        LIMIT ?
        OFFSET ?;